export default function EventsPage(){
    async function fetchEvents(){
        const response=fetch("http://localhost:8080/events")
        if(!response.ok){
            return;
        }else{
            const resData=await response.json();
            console.log(resData.events)
        }
        
    }
    fetchEvents()
    return(
        <h1>Events Page</h1>
    )
}
